        function ListarDesenvolvedor() {
            if ($(""#Id_Projeto"").val() == 0) {
                $(""#Id_Desenvolvedor"").addClass(""campoReadOnly"");
                $(""#Id_Desenvolvedor"").append(
                    '<option value="""">-- Selecione um projeto --</option>'
                );
            }
